import React, { Component } from 'react';

import Header from '../components/Header'

class index extends Component {

  render() {
    return (
      <div>
        <Header />
        <div className="bg">
          <div className="container px-0">
            <section className="d-flex flex-column align-items-center justify-content-center intro">
              <h1 class="display-4 text-info font-l">
                The smartest way to own your home
              </h1>
              <h5 class="text-light pt-5 font-r">
                Home 360 utilizes the most cutting-edge technologies to facilitate buy/sell a house
              </h5>
              <p class="text-secondary font-l">
                scroll down for more info
              </p>
            </section>

            <section>
              <div className="row mt-5  bg-warning">
                <div className="bg-success col-md-4 d-flex flex-column justify-content-center align-items-center">
                  <div className="d-flex justify-content-center align-items-center circle my-3">
                    <i class="fas fa-chart-area fa-5x"></i>
                  </div>
                  <p className="font-l text-center">
                    By analyzing historical pricing data against about 50 metrics on location
                    and things like transportation, crime, schools, etc Our machine learning algorithms can
                    accurately forecast which homes, and even neighborhoods will experience the
                    biggest bump in value over a certain time period</p>
                </div>
                <div className="col-md-4 d-flex flex-column justify-content-center align-items-center">
                  <div className="d-flex justify-content-center align-items-center circle my-3">
                    <i class="fas fa-vr-cardboard fa-5x" />
                  </div>
                  <p className="font-l text-center">this is vr</p>
                </div>
                <div className="col-md-4 d-flex flex-column justify-content-center align-items-center">
                  <div className="d-flex justify-content-center align-items-center circle my-3">
                    <i class="fas fa-bell fa-5x"></i>
                  </div>
                  <p className="font-l text-center">this is notification</p>
                </div>
              </div>
            </section>
          </div>
        </div>
      <style>{`
          p {
            color: white;
          }

          .font-l {
            font-family: Open Sans;
            font-weight: 300;
          }

          .font-r {
            font-family: Open Sans;
            font-weight: 400;
          }

          .font-b {
            font-family: Open Sans;
            font-weight: 600;
          }

          .bg {
            background: black;
          }

          .intro {
            height: 90vh;
            background: gray;
          }

          i {
            color: #17a2bb;
            color: white
          }

          .circle {
            height: 200px;
            width: 200px;
            background: pink;
            border-radius: 100px;
            border: 1px solid white;
          }

        `}</style>
      </div>
    );
  }
}

export default index;
